<!DOCTYPE html>
<html lang="en" dir="ltr" class="client-js">
  <head>
    <title style="display: none">{{page.title}}</title>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <link rel="stylesheet" href="{{ site.baseurl }}/assets/css/styles.css" />
    <!-- Link to CSS files -->
    <link
      rel="stylesheet"
      href="{{ site.baseurl }}/assets/css/code-editor.css"
    />
    <link
      rel="stylesheet"
      href="{{ site.baseurl }}/assets/css/suggestions.css"
    />
    <link rel="stylesheet" href="{{ site.baseurl }}/assets/css/links.css" />
    <link rel="stylesheet" href="{{ site.baseurl }}/assets/css/text.css" />
    <link rel="stylesheet" href="{{ site.baseurl }}/assets/css/error.css" />
    <link
      rel="stylesheet"
      href="{{ site.baseurl }}/assets/css/ace_editor.css"
    />
    <link rel="stylesheet" href="{{ site.baseurl }}/assets/css/ace-tm.css" />
  </head>
  <body
    class="mediawiki ltr page-cpp_container_deque_deque skin-cppreference2 action-view vsc-initialized"
  >
    <div id="mw-head" class="noprint">
      <div id="cpp-head-first-base">
        <div id="cpp-head-first">
          <h5><a href="/"> containderofuniqueentries-doc </a></h5>
          <div id="cpp-head-search">
            <!-- 0 -->
            <div id="p-search">
              <form action="https://duckduckgo.com/" method="get">
                <input type="hidden" name="sites" value="cppreference.com" />
                <input type="search" name="q" />
                <input type="submit" value="Search" />
              </form>
            </div>

            <!-- /0 -->
          </div>
          <div id="cpp-head-personal">
            <!-- 0 -->
            <div id="p-personal" class="">
              <span id="pt-createaccount"></span>
              <div class="menu">
                <ul>
                  <li id="pt-login"></li>
                </ul>
              </div>
            </div>

            <!-- /0 -->
          </div>
        </div>
      </div>
      <div id="cpp-head-second-base">
        <div id="cpp-head-second">
          <div id="cpp-head-tools-left">
            <!-- 0 -->
            <div id="p-namespaces" class="vectorTabs">
              <h5>Namespaces</h5>
              <ul>
                <li id="ca-nstab-main" class="selected">
                  <span
                    ><a
                      href="{{ '/_docs/deque_of_unique/index' | relative_url }}"
                      title="deque_of_unique"
                      accesskey="c"
                      >deque_of_unique</a
                    ></span
                  >
                </li>
                <li id="ca-talk">
                  <span
                    ><a
                      href="{{ '/_docs/vector_of_unique/index' | relative_url }}"
                      title="vector_of_unique"
                      accesskey="t"
                      >vector_of_unique</a
                    ></span
                  >
                </li>
              </ul>
            </div>

            <!-- /0 -->

            <!-- 1 -->
            <div id="p-variants" class="vectorMenu emptyPortlet">
              <h5><span>Variants</span><a href="#"></a></h5>
              <div class="menu">
                <ul></ul>
              </div>
            </div>

            <!-- /1 -->
          </div>
          <div id="cpp-head-tools-right">
            <div class="stdrev-select">
              <div>
                <span class="stdrev-text"> </span>
              </div>
            </div>
            <div id="p-cactions" class="vectorMenu emptyPortlet">
              <h5><span>Actions</span><a href="#"></a></h5>
              <div class="menu">
                <ul></ul>
              </div>
            </div>

            <!-- /1 -->
          </div>
        </div>
      </div>
    </div>
    <style type="text/css">
      #carbonads {
        display: block;
        overflow: hidden;
        position: absolute;
        text-align: center;
        left: -170px;
        max-width: 150px;
        border-radius: 4px;
        border: solid 1px hsla(0, 0%, 0%, 0.1);
        background-color: hsl(0, 0%, 98%);
        font-size: 12px;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto,
          Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", Helvetica, Arial,
          sans-serif;
        line-height: 1.5;
      }

      #carbonads a {
        color: inherit;
        text-decoration: none;
      }

      #carbonads a:hover {
        color: inherit;
      }

      #carbonads span {
        position: relative;
        display: block;
        overflow: hidden;
      }

      .carbon-img {
        display: block;
        margin-bottom: 8px;
        max-width: 150px;
        line-height: 1;
      }

      .carbon-img img {
        display: block;
        margin: 0 auto;
        max-width: 150px !important;
        width: 150px;
        height: auto;
      }

      .carbon-text {
        display: block;
        padding: 0 1em 8px;
      }

      .carbon-poweredby {
        display: block;
        padding: 8px 12px;
        background: repeating-linear-gradient(
            -45deg,
            transparent,
            transparent 5px,
            hsla(0, 0%, 0%, 0.025) 5px,
            hsla(0, 0%, 0%, 0.025) 10px
          )
          hsla(203, 11%, 95%, 0.4);
        text-transform: uppercase;
        letter-spacing: 0.5px;
        font-weight: 600;
        font-size: 9px;
        line-height: 1;
      }
      html {
        font-variant-ligatures: no-common-ligatures;
      }
    </style>
    <div id="cpp-content-base">
      <div id="content">
        <a id="top"></a>
        <div id="mw-js-message" style="display: none"></div>
        <div id="bodyContent">
          <div id="siteSub">
            From https://huanhuan-jiang.github.io/containerofuniqueentries-doc/
          </div>
          <div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr">
            {{ content }}
          </div>
          <!-- This will render the content from index.md -->
        </div>
      </div>
    </div>
    <!-- Include the footer -->
    {% include footer.html %}
  </body>
</html>
